pragma solidity ^0.5.16;
pragma experimental ABIEncoderV2;

contract PvContract {

    string public name;
    uint public passportCount = 0;
    uint public visaCount = 0;

    struct Citizen {
        string citizenName;
        string identityNo;
        address citizenAddress;
        uint userType;
        uint portalId;
        int passportIndex;
        bool exists;
    }

    struct CitizenPassport {
        address citizenPassportAddress;
        address citizenAddress;
        uint passportAgencyId;
        uint passportBranchId;
        string passportType;
        uint256 issuanceExpiry;
        uint256 issuanceDate;
        string status;
        uint signed;
        uint256 signedDate;
    }

    struct CitizenVisa {
        address citizenVisaAddress;
        address citizenAddress;
        address citizenPassportAddress;

        uint foreignVisaAgencyBranchId;
        uint foreignVisaAgencyId;
        uint256 issuanceDate;
        uint256 issuanceExpiry;
        uint signed;
        uint256 signedDate;
    }

    struct CitizenImmigration {
        address citizenImmigrationAddress;
        address citizenAddress;
        string immigrationName;
        string branchId;
        uint256 immigrationTime;
        uint isCheckIn; //0 means check in, 1 means checkout
        uint signed;
        uint256 signedDate;
    }

    struct PvCitizenPassport {
        address citizenAddress;
        uint citizenPassportId;
    }

    struct PvCitizenVisa {
        address citizenAddress;
        uint citizenVisaId;
    }

    struct PvCitizenImmigration {
        address citizenAddress;
        uint citizenImmigrationId;
    }

    struct PvCitizen {
        string citizenName;
        string identityNo;
        address citizenAddress;
    }


    mapping(address => Citizen) public citizens;
    mapping(address => CitizenVisa[]) public citizenVisas;
    mapping(address => CitizenImmigration[]) public citizenImmigrations;
    mapping(address => PvCitizenPassport[]) public pvCitizenPassports;
    mapping(address => PvCitizenVisa[]) public pvCitizenVisas;
    mapping(address => PvCitizenImmigration[]) public pvCitizenImmigrations;

    CitizenPassport[] public citizenPassports;
    PvCitizen[] public pvCitizens;


    constructor() public {
    }

    function createCitizen(string memory citizenName, string memory identityNo, uint userType, uint portalId) public {
        address user = msg.sender;
        require(!citizens[user].exists, "$Citizen address already present$");

        citizens[user] = Citizen(citizenName, identityNo, msg.sender, userType, portalId, -1,true);
        if (userType == 102) {
            pvCitizens.push(PvCitizen(citizenName, identityNo, msg.sender));
        }
    }

    function createCitizenPassport(uint passportAgencyId, uint passportBranchId,
        string memory passportType, uint256 issuanceExpiry, uint256 issuanceDate,
        string memory status) public {

        address citizenAddress = msg.sender;
        require(citizens[citizenAddress].userType == 118, "$Not Authorized for Passport Creation$");

        citizenPassports.push(CitizenPassport(address(0), citizenAddress, passportAgencyId, passportBranchId,
            passportType, issuanceExpiry, issuanceDate, status, 0, 0));

        uint passportIndex = citizenPassports   .length - 1;
        // pvCitizenPassports[passportAgency].push(PvCitizenPassport(citizenAddress, passportIndex));
        citizens[citizenAddress].passportIndex = int256(passportIndex);
    }

    function createCitizenVisa(uint foreignVisaAgencyBranchId, uint foreignVisaAgencyId,
        uint256 issuanceDate, uint256 issuanceExpiry) public {

        // address visaAgency = msg.sender;
        address citizenAddress = msg.sender;
        require(citizens[citizenAddress].userType == 118, "$Not Authorized for Visa Creation$");

        Citizen memory citizen = citizens[citizenAddress];
        uint256 citizenPassportIndex = uint256 (citizen.passportIndex);

        CitizenPassport memory citizenPassport = citizenPassports[citizenPassportIndex];
        citizenVisas[citizenAddress].push(
            CitizenVisa(address(0), citizenAddress, citizenPassport.citizenPassportAddress, foreignVisaAgencyBranchId, foreignVisaAgencyId,
            issuanceDate, issuanceExpiry, 0, 0));

        uint visaIndex = citizenVisas[citizenAddress].length - 1;
        pvCitizenVisas[citizenAddress].push(PvCitizenVisa(citizenAddress, visaIndex));

    }

    function createCitizenImmigration(string memory immigrationName,
        string memory branchId, uint256 immigrationTime, uint isCheckIn) public {

        address citizenAddress = msg.sender;
        require(citizens[citizenAddress].userType == 118, "$Not Authorized for Immigration Request Creation$");

        citizenImmigrations[citizenAddress].push(
            CitizenImmigration(address(0), citizenAddress, immigrationName, branchId,
            immigrationTime, isCheckIn, 0, 0));

        uint immigrationIndex = citizenImmigrations[citizenAddress].length - 1;
        pvCitizenImmigrations[citizenAddress].push(PvCitizenImmigration(citizenAddress, immigrationIndex));
    }

    function getCitizenPassport(address citizenAddress) public view returns (CitizenPassport memory) {

        Citizen memory citizen = citizens[citizenAddress];
        require(citizen.passportIndex >= 0, "$No Passport Found$");
        CitizenPassport memory citizenPassport = citizenPassports[uint256(citizen.passportIndex)];

        return citizenPassport;
    }

    function getCitizenVisas(address citizen) public view returns (CitizenVisa[] memory) {
        CitizenVisa[] memory visas = new CitizenVisa[](citizenVisas[citizen].length);
        for (uint i = 0; i < citizenVisas[citizen].length; i++) {
            CitizenVisa storage visa = citizenVisas[citizen][i];
            visas[i] = visa;
        }
        return visas;
    }

    function getCitizenImmigrations(address citizen) public view returns (CitizenImmigration[] memory) {
        CitizenImmigration[] memory immigrations = new CitizenImmigration[](citizenImmigrations[citizen].length);
        for (uint i = 0; i < citizenImmigrations[citizen].length; i++) {
            CitizenImmigration storage immigration = citizenImmigrations[citizen][i];
            immigrations[i] = immigration;
        }
        return immigrations;
    }

    function signPassport(address citizenAddress, uint signed) public {
        address user = msg.sender;
        require(citizens[user].userType == 113, "$Not Authorized for Passport Approval/Rejection$");

        Citizen memory citizen = citizens[citizenAddress];
        uint256 citizenPassportIndex = uint256 (citizen.passportIndex);
        CitizenPassport memory passport = citizenPassports[citizenPassportIndex];
        passport.citizenPassportAddress = user;
        passport.signed = signed;
        passport.signedDate = block.timestamp;

        citizenPassports[citizenPassportIndex] = passport;
    }

    function signVisa(address citizenAddress, uint index, uint signed) public {
        address user = msg.sender;
        require(citizens[user].userType == 115, "$Not Authorized for Visa Approval/Rejection");
        CitizenVisa memory visa = citizenVisas[citizenAddress][index];
        visa.signed = signed;
        visa.signedDate = block.timestamp;
        visa.citizenVisaAddress = user;
        citizenVisas[citizenAddress][index] = visa;
    }

    function signImmigration(address citizenAddress, uint index, uint signed) public {
        address user = msg.sender;
        require(citizens[user].userType == 117, "$Not Authorized for Immigration Approval/Rejection");
        CitizenImmigration memory immigration = citizenImmigrations[citizenAddress][index];
        immigration.signed = signed;
        immigration.signedDate = block.timestamp;
        immigration.citizenImmigrationAddress = user;
        citizenImmigrations[citizenAddress][index] = immigration;
    }


}
